import React, { useEffect, useState } from "react";
import Navbar from "../components/navbar";
import "./help.css";
import Card from "../components/card";
const Help = () => {
  return (
    <div>
      <Navbar />
      <h1>ทำอย่างไรเมื่อโดนโกง</h1>
      <div className="container-help">
        <div className="row">
          <div className="column">
              <Card />
          </div>
          <div className="column">
              <Card />
          </div>
          <div className="column">
              <Card />
          </div>
          <div className="column">
              <Card />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Help;
